(235, 'App\\User', 1524, 'created', 'App\\Models\\Event', 61, '[]', '{"allow_in_scheduled_email":"Y","title":"Raising of ThreatCon Level to Yellow Heightened Alert","description":"National Terrorism ThreatCon Framework, ThreatCon Yellow-HA can be pre-emptively declared for high-security, pre-planned events. The change in THREATCON level is expected to last for 14 days scheduled to sunset at 2359hrs, unless an extension is deemed to be necessary.\\n\\nEPRs as well as our security provider Certis CISCO on the change of status will be informed as well as the corresponding additional measures in line with Yellow Heightened Alert for immediate implementation. As mentioned in MHA email that whilst we heightened our security measures, we should not communicate the heightened ThreatCon level beyond the government agencies. The additional measures are:\\na.\\t100% check for all visitors and resident staff\\/vehicle entering\\/leaving PUB CI at all time.\\nb.\\t3 day patrols and 4 night patrols.\\nc.\\t6 CISCO Validation Exercises every month. \\n  \\nThe guards are also reminded to:\\na.\\tbe vigilant and alert and to report any suspicious activities and incidents promptly; \\nb.\\tmanage access control tightly;\\nc.\\tperform patrol duties carefully as required by the patrol schedule and route prescribed;\\nd.\\tconduct security systems check and ensure it is in working condition and to report any defects promptly for rectification;\\ne.\\tbe on the lookout for any suspicious activities around the perimeter of the installation and to check out such activities properly and thoroughly. CISCO IOC should be quickly updated so that it can guide the APOs\\/POs as necessary. Installation management must also be kept informed without delay;\\nf.\\tinvestigate all alarm activations as per the SOP; and\\ng.\\tincrease the number of supervisory checks on a daily basis with particular attention to the above as well as conducting in-house security and contingency exercises to validate the readiness of the officers.\\n\\nEPU\\/JOD and HSS\\/CSD will also follow up with calls and will be conducting additional random checks at PUB installations to ensure vigilance and compliance to the enhanced security measures.\\n","venue":"ALL PUB CIs, including DBOO operators","end_date":"2018-01-02","start_date":"2017-12-22","security_level":"4","group_id":null,"id":61,"group_name":""}', 'http://emsapi.inhousedev.pub.gov.sg/event?', '10.206.208.121', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/65.0.3325.181 Safari/537.36', NULL, '2018-07-02 07:23:48', '2018-07-02 07:23:48'),
