(1, '<h5 style="font-style: italic;">Message Classification:<span style="color: #0000ff;">Restricted</span></h5><p><br></p><p><span style="font-size: 12px; font-family: calibri;">Dear All,</span></p><p style="padding-left: 5px;"><span style="font-size: 12px;"><span style="font-family: calibri;">MHA has confirmed the next upcoming major national event on {UPCOMING_EVENT_DATE} as below.</span></span></p><p><span style="font-size: 12px;"><span style="font-family: calibri;">{INDIVIDUAL_EVENT}</span></span></p><p><span style="font-size: 12px;"><span style="font-family: calibri;">Depts are reminded to prepare and also remind staff to continue to stay alert and maintain/exercise high vigilance accordingly during the period.</span></span></p><p><span style="font-size: 12px;"><span style="font-family: calibri;"><span style="color: black;">PUBOC will continue in coordinating the joint ops within PUB. EPU will serve as the Point-Of-Contact to MHA, SPF, SCDF and other HomeFront Agencies and will follow up with the required procedures/linkages with SCDF&rsquo;s command elements at their Tactical Command HQ during its deployment.</span></span></span></p><p style=\'margin:0cm;margin-bottom:.0001pt;font-size:16px;font-family:"Times New Roman",serif;text-align:justify;\'><span style="font-size: 12px; font-family: calibri;">Thank you.</span></p><p style=\'margin:0cm;margin-bottom:.0001pt;font-size:16px;font-family:"Times New Roman",serif;text-align:justify;\'><br></p><p style=\'margin:0cm;margin-bottom:.0001pt;font-size:16px;font-family:"Times New Roman",serif;text-align:justify;\'><br></p><p><span style="font-size: 12px; font-family: calibri;">====================================================================================</span></p><p style=\'margin:0cm;margin-bottom:.0001pt;font-size:16px;font-family:"Times New Roman",serif;\'><span style="font-family: calibri;"><span style="font-size: 12px;"><strong>From:</strong> Heng Hui LAU (PUB)<br>&nbsp;<strong>Sent:</strong> Monday, 5 February, 2018 9:26 AM<br>&nbsp;<strong>To:</strong> Yong Yang WONG (PUB) &lt;<a href="mailto:WONG_Yong_Yang@pub.gov.sg">WONG_Yong_Yang@pub.gov.sg</a>&gt;; Choon Pau CHANG (PUB) &lt;<a href="mailto:CHANG_Choon_Pau@pub.gov.sg">CHANG_Choon_Pau@pub.gov.sg</a>&gt;; Wee Leong YEO (PUB) &lt;<a href="mailto:YEO_Wee_Leong@pub.gov.sg">YEO_Wee_Leong@pub.gov.sg</a>&gt;; Yake Leong SOH (PUB) &lt;<a href="mailto:SOH_Yake_Leong@pub.gov.sg">SOH_Yake_Leong@pub.gov.sg</a>&gt;; Kah Cheong LAI (PUB) &lt;<a href="mailto:LAI_Kah_Cheong@pub.gov.sg">LAI_Kah_Cheong@pub.gov.sg</a>&gt;; Mocktarhe ALOM (PUB) &lt;<a href="mailto:Mocktarhe_ALOM@pub.gov.sg">Mocktarhe_ALOM@pub.gov.sg</a>&gt;; Ganesan NARAYANAN (PUB) &lt;<a href="mailto:Ganesan_NARAYANAN@pub.gov.sg">Ganesan_NARAYANAN@pub.gov.sg</a>&gt;; Boo Teng CHONG (PUB) &lt;<a href="mailto:CHONG_Boo_Teng@pub.gov.sg">CHONG_Boo_Teng@pub.gov.sg</a>&gt;; Kang Keong LIAU (PUB) &lt;<a href="mailto:LIAU_Kang_Keong@pub.gov.sg">LIAU_Kang_Keong@pub.gov.sg</a>&gt;; Wai Kwong CHOY (PUB) &lt;<a href="mailto:CHOY_Wai_Kwong@pub.gov.sg">CHOY_Wai_Kwong@pub.gov.sg</a>&gt;; Jason WONG (PUB) &lt;<a href="mailto:Jason_WONG@pub.gov.sg">Jason_WONG@pub.gov.sg</a>&gt;; Yih Sheng CHUA (PUB) &lt;<a href="mailto:CHUA_Yih_Sheng@pub.gov.sg">CHUA_Yih_Sheng@pub.gov.sg</a>&gt;; Jing Sheng CHIA (PUB) &lt;<a href="mailto:CHIA_Jing_Sheng@pub.gov.sg">CHIA_Jing_Sheng@pub.gov.sg</a>&gt;; Wee Siang LIOW (PUB) &lt;<a href="mailto:LIOW_Wee_Siang@pub.gov.sg">LIOW_Wee_Siang@pub.gov.sg</a>&gt;; M Jufri YUSOF (PUB) &lt;<a href="mailto:M_Jufri_YUSOF@pub.gov.sg">M_Jufri_YUSOF@pub.gov.sg</a>&gt;; Abdullah Tawfiq ABDUL RAHMAN (PUB) &lt;<a href="mailto:Abdullah_Tawfiq_ABDUL_RAHMAN@pub.gov.sg">Abdullah_Tawfiq_ABDUL_RAHMAN@pub.gov.sg</a>&gt;<br>&nbsp;<strong>Cc:</strong> PUB-SMM &lt;<a href="mailto:PUB-SMM@pub.gov.sg">PUB-SMM@pub.gov.sg</a>&gt;; Kah Poh PENG (PUB) &lt;<a href="mailto:PENG_Kah_Poh@pub.gov.sg">PENG_Kah_Poh@pub.gov.sg</a>&gt;; Abd Khalik ABD LATIFF (PUB) &lt;<a href="mailto:Abd_Khal