001pt;font-size:16px;font-family:"Times New Roman",serif;\'><span style="font-family: calibri;"><span style="font-size: 12px;"><span style="color: black;">Dear all,</span></span></span></p><p style=\'margin:0cm;margin-bottom:.0001pt;font-size:16px;font-family:"Times New Roman",serif;\'><span style="font-family: calibri;"><span style="font-size: 12px;"><br></span></span></p><p style=\'margin:0cm;margin-bottom:.0001pt;font-size:16px;font-family:"Times New Roman",serif;text-align:justify;\'><span style="font-family: calibri;"><span style="font-size: 12px;"><span style="color: black;">Do take note of the upcoming major National events for Year 2018, gathered from SCDF and SPF, as shown in the table appended below.&nbsp;</span></span></span></p><p style=\'margin:0cm;margin-bottom:.0001pt;font-size:16px;font-family:"Times New Roman",serif;text-align:justify;\'><span style="font-family: calibri;"><span style="font-size: 12px;"><br></span></span></p><p style=\'margin:0cm;margin-bottom:.0001pt;font-size:16px;font-family:"Times New Roman",serif;text-align:justify;\'><span style="font-family: calibri;"><span style="font-size: 12px;"><span style="color: black;">The&nbsp;</span>next upcoming major national event is the <strong><u>CNY Garden Party and CNY Reception</u></strong> on 25 and 26 Feb 2018 respectively to be held at <strong><u>Istana</u></strong>. &nbsp;</span></span></p><p style=\'margin:0cm;margin-bottom:.0001pt;font-size:16px;font-family:"Times New Roman",serif;text-align:justify;\'><span style="font-family: calibri;"><span style="font-size: 12px;"><br></span></span></p><p style=\'margin:0cm;margin-bottom:.0001pt;font-size:16px;font-family:"Times New Roman",serif;text-align:justify;\'><span style="font-family: calibri;"><span style="font-size: 12px;"><span style="color: black;">On below-mentioned periods, Ops Departments are to exercise due diligence and to stay alert/vigilant.&nbsp;</span></span></span></p><p style=\'margin:0cm;margin-bottom:.0001pt;font-size:16px;f