(2, '<h5 style="font-style: italic;"><span style="font-size: 12px; font-family: calibri;">Message Classification:<span style="color: #0000ff;">Restricted</span></span></h5><p><span style="font-family: calibri;"><span style="font-size: 12px;"><br></span></span></p><p><span style="font-family: calibri;"><span style="font-size: 12px;">Dear All,</span></span></p><p><br></p><p><span style="font-family: calibri;"><span style="font-size: 12px;">MHA has also confirmed the next upcoming major national event on {UPCOMING_EVENT_DATE} as below.</span></span></p><p><span style="font-family: calibri;"><span style="font-size: 12px;">{GROUP_EVENT}</span></span></p><p style="padding:0 5px;"><span style="font-family: calibri;"><span style="font-size: 12px;">Depts are reminded to prepare and also remind staff to continue to stay alert and maintain/exercise high vigilance accordingly during the period.</span></span></p><p><span style="font-family: calibri;"><span style="font-size: 12px;">JOD/PUBOC will continue to coordinate joint ops within PUB while JOD/EPU will serve as the Point-Of-Contact to MHA, SPF, SCDF and other HomeFront Agencies. JOD/EPU will also follow up with the required procedures/linkages with SCDF&rsquo;s command elements at their Tactical Command HQ in the event of its deployment.</span></span></p><p><span style="font-family: calibri;"><span style="font-size: 12px;">Thank You.</span></span></p><p><span style="font-family: calibri;"><span style="font-size: 12px;">====================================================================================</span></span></p><p style=\'margin:0cm;margin-bottom:.0001pt;font-size:16px;font-family:"Times New Roman",serif;\'><span style="font-family: calibri;"><span style="font-size: 12px;"><strong>From:</strong> Heng Hui LAU (PUB)<br>&nbsp;<strong>Sent:</strong> Monday, 5 February, 2018 9:26 AM<br>&nbsp;<strong>To:</strong> Yong Yang WONG (PUB) &lt;<a href="mailto:WONG_Yong_Yang@pub.gov.sg">WONG_Yong_Yang@pub.gov.sg</a>&gt;; Choon P