(59, 'Raising of ThreatCon Level to Yellow Heightened Alert ', 'National Terrorism ThreatCon Framework, ThreatCon Yellow-HA can be pre-emptively declared for high-security, pre-planned events. The change in THREATCON level is expected to last for 14 days scheduled to sunset at 2359hrs, unless an extension is deemed to be necessary.\n\nEPRs as well as our security provider Certis CISCO on the change of status will be informed as well as the corresponding additional measures in line with Yellow Heightened Alert for immediate implementation. As mentioned in MHA email that whilst we heightened our security measures, we should not communicate the heightened ThreatCon level beyond the government agencies. The additional measures are:\na.	100% check for all visitors and resident staff/vehicle entering/leaving PUB CI at all time.\nb.	3 day patrols and 4 night patrols.\nc.	6 CISCO Validation Exercises every month. \n  \nThe guards are also reminded to:\na.	be vigilant and alert and to report any suspicious activities and incidents promptly; \nb.	manage access control tightly;\nc.	perform patrol duties carefully as required by the patrol schedule and route prescribed;\nd.	conduct security systems check and ensure it is in working condition and to report any defects promptly for rectification;\ne.	be on the lookout for any suspicious activities around the perimeter of the installation and to check out such activities properly and thoroughly. CISCO IOC should be quickly updated so that it can guide the APOs/POs as necessary. Installation management must also be kept informed without delay;\nf.	investigate all alarm activations as per the SOP; and\ng.	increase the number of supervisory checks on a daily basis with particular attention to the above as well as conducting in-house security and contingency exercises to validate the readiness of the officers.\n\nEPU/JOD and HSS/CSD will also follow up with calls and will be conducting additional random checks at PUB installations to ensure vigilance and compliance to the enhanced security measures.', '2017-05-25', '2017-06-26', 'ALL PUB CIs, including DBOO operators', '4', NULL, 'N', '2018-07-02 07:21:58', '2018-07-02 07:21:58', NULL),
(60, 'Raising of ThreatCon Level to Yellow Heightened Alert', 'National Terrorism ThreatCon Framework, ThreatCon Yellow-HA can be pre-emptively declared for high-security, pre-planned events. The change in THREATCON level is expected to last for 14 days scheduled to sunset at 2359hrs, unless an extension is deemed to be necessary.\n\nEPRs as well as our security provider Certis CISCO on the change of status will be informed as well as the corresponding additional measures in line with Yellow Heightened Alert for immediate implementation. As mentioned in MHA email that whilst we heightened our security measures, we should not communicate the heightened ThreatCon level beyond the government agencies. The additional measures are:\na.	100% check for all visitors and resident staff/vehicle entering/leaving PUB CI at all time.\nb.	3 day patrols and 4 night patrols.\nc.	6 CISCO Validation Exercises every month. \n  \nThe guards are also reminded to:\na.	be vigilant and alert and to report any suspicious activities and incidents promptly; \nb.	manage access control tightly;\nc.	perform patrol duties carefully as required by the patrol schedule and route prescribed;\nd.	conduct security systems check and ensure it is in working condition and to report any defects promptly for rectification;\ne.	be on the lookout for any suspicious activities around the perimeter of the installation and to check out such activities properly and thoroughly. CISCO IOC should be quickly updated so that it can guide the APOs/POs as necessary. Installation management must also be kept informed without delay;\nf.	investigate all alarm activations as per the SOP; and\ng.	increase the number of supervisory checks on a daily basis with particular attention to the above as well as conducting in-house security and contingency exercises to validate the readiness of the officers.\n\nEPU/JOD and HSS/CSD will also follow up with calls and will be conducting additional random checks at PUB installations to ensure vigilance and compliance to the enhanced security measures.\n', '2017-08-04', '2017-08-10', 'ALL PUB CIs, including DBOO operators', '4', NULL, 'N', '2018-07-02 07:22:45', '2018-07-02 07:22:45', NULL),
(61, 'Raising of ThreatCon Level to Yellow Heightened Alert', 'National Terrorism ThreatCon Framework, ThreatCon Yellow-HA can be pre-emptively declared for high-security, pre-planned events. The change in THREATCON level is expected to last for 14 days scheduled to sunset at 2359hrs, unless an extension is deemed to be necessary.\n\nEPRs as well as our security provider Certis CISCO on the change of status will be informed as well as the corresponding additional measures in line with Yellow Heightened Alert for immediate implementation. As mentioned in MHA email that whilst we heightened our security measures, we should not communicate the heightened ThreatCon level beyond the government agencies. The additional measures are:\na.	100% check for all visitors and resident staff/vehicle entering/leaving PUB CI at all time.\nb.	3 day patrols and 4 night patrols.\nc.	6 CISCO Validation Exercises every month. \n  \nThe guards are also reminded to:\na.	be vigilant and alert and to report any suspicious activities and incidents promptly; \nb.	manage access control tightly;\nc.	perform patrol duties carefully as required by the patrol schedule and route prescribed;\nd.	conduct security systems check and ensure it is in working condition and to report any defects promptly for rectification;\ne.	be on the lookout for any suspicious activities around the perimeter of the installation and to check out such activities properly and thoroughly. CISCO IOC should be quickly updated so that it can guide the APOs/POs as necessary. Installation management must also be kept informed without delay;\nf.	investigate all alarm activations as per the SOP; and\ng.	increase the number of supervisory checks on a daily basis with particular attention to the above as well as conducting in-house security and contingency exercises to validate the readiness of the officers.\n\nEPU/JOD and HSS/CSD will also follow up with calls and will be conducting additional random checks at PUB installations to ensure vigilance and compliance to the enhanced security measures.\n', '2017-12-22', '2018-01-02', 'ALL PUB CIs, including DBOO operators', '4', NULL, 'N', '2018-07-02 07:23:48', '2018-07-02 07:24:21', NULL),
(62, 'Raising of ThreatCon Level to Yellow Heightened Alert', 'National Terrorism ThreatCon Framework, ThreatCon Yellow-HA can be pre-emptively declared for high-security, pre-planned events. The change in THREATCON level is expected to last for 14 days scheduled to sunset at 2359hrs, unless an extension is deemed to be necessary.\n\nEPRs as well as our security provider Certis CISCO on the change of status will be informed as well as the corresponding additional measures in line with Yellow Heightened Alert for immediate implementation. As mentioned in MHA email that whilst we heightened our security measures, we should not communicate the heightened ThreatCon level beyond the government agencies. The additional measures are:\na.	100% check for all visitors and resident staff/vehicle entering/leaving PUB CI at all time.\nb.	3 day patrols and 4 night patrols.\nc.	6 CISCO Validation Exercises every month. \n  \nThe guards are also reminded to:\na.	be vigilant and alert and to report any suspicious activities and incidents promptly; \nb.	manage access control tightly;\nc.	perform patrol duties carefully as required by the patrol schedule and route prescribed;\nd.	conduct security systems check and ensure it is in working condition and to report any defects promptly for rectification;\ne.	be on the lookout for any suspicious activities around the perimeter of the installation and to check out such activities properly and thoroughly. CISCO IOC should be quickly updated so that it can guide the APOs/POs as necessary. Installation management must also be kept informed without delay;\nf.	investigate all alarm activations as per the SOP; and\ng.	increase the number of supervisory checks on a daily basis with particular attention to the above as well as conducting in-house security and contingency exercises to validate the readiness of the officers.\n\nEPU/JOD and HSS/CSD will also follow up with calls and will be conducting additional random checks at PUB installations to ensure vigilance and compliance to the enhanced security measures.\n', '2018-05-13', '2018-06-18', 'ALL PUB CIs, including DBOO operators', '4', NULL, 'N', '2018-07-02 07:25:15', '2018-07-02 07:25:15', NULL);
